import React from "react";
import { socialMedia } from "./config";

const Social: React.FC = () => {
  return (
    <div>
      <ul>
        {socialMedia.map((icon: any, index: number) => (
          <li key={index}>
            <a href={icon.url}>
              <img src={icon.icon} alt="" />
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Social;
